        "_id": "6274bef233b3445e5c34e364",
        "title": "All Time Top Grossing Movies in Hindi Belt: KGF 2 Beats Aamir Khan's Dangal, Salman Khan's Tiger Zinda Hai",
        "decription": "Yash and Prashanth Neel's KGF Chapter 2 is in the second place in the all-time highest-grossing movies in the Hindi belt and next only to SS Rajamouli's Baahubali 2.Kannada actor Yash's pan-India movie KGF: Chapter 2 has a remarkable day at the box office in Hindi belt on Tuesday on the occasion of Eid festival. The multilingual movie has performed better than the new Bollywood releases like Ajay Devgn's Runway 34 and Tiger Shroff's Heropanti 2.The Prashanth Neel's creation, which made a net collection of Rs 8.5 crore on Eid, is now at the second place in the list of all-time top-grossing movies in Hindi belt. KGF 2 has earned Rs 440 crore in 20 days at the Hindi belt.KGF 2 has beaten Aamir Khan's Dangal which had grossed Rs 410 crore in its lifetime. SS Rajamouli's Baahubali 2 is in the number one place in the list of all-time top-grossing movies in the Hindi belt.Trade trackers are predicting the Yash-starrer to cross Rs 400 crore net collection in the Hindi belt.  KGF 2 is the fourth Indian movie to reach Rs 1000-crore mark at the worldwide box office after Dangal (lifetime collection: Rs 2,024 crore), Baahubali 2 (lifetime collection: Rs 1,810 crore) and RRR (Rs 1091.9 crore).The movie has minted over Rs 100 crore in Karnataka, Andhra and Tamil Nadu despite facing competition from Vijay's Beast.The Hombale Films-funded movie is already the second highest-grossing film in the post-pandemic era after Ram Charan and Junior NTR's RRR.The movie was released in April 14 in five languages - Kannada, Telugu, Hindi, Tamil and Malayalam languages. KGF 2 tells the story of rise and fall of Rocky Bhai played by Yash. Bollywood actors Sanjay Dutt and Raveena Tandon played key roles in the flick.",
